// const responsive = {
//   0: { items: 1 },
//   568: { items: 2 },
//   1024: { items: 3 },
// };

const items = MainCarousaldata.map;

const MainCarousal = () => (
  <AliceCarousel
    mouseTracking
    items={items}
    // responsive={responsive}
    controlsStrategy="alternate"
  />
);

export default MainCarousal;
